const App = () => {
  return (
    <BrowserRouter>
    <Routes>
      <Route exact path="/" element={<Home />}>
      </Route>  
        <Route path="/movies" element={<Home type="movies" />}>
        <Route path="/series" element={<Home type="series" />}>

      </Route>
      </Route>
    </Routes>
  </BrowserRouter>
  );
};

export default App;
